import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import ArticleComponent from './Article/ArticleComponent';
import ArticleNavBar from './ActicleNavBar/ArticleNavBar';
import HomeComponent from './Home/HomeComponent';

class ArticleApp extends Component {

    constructor(props) {
        super(props);
        this.handleHomeClick = this.handleClick.bind(this);
        selectedTab = 0;
      }

      handleHomeClick() {
        this.props.history.push('/articles');
      }

    render() {
        return (
            <Router>
                <>
                    <Switch>
                        <Route path="/" exact component={HomeComponent} />
                        <Route path="/articles" exact component={HomeComponent} /> 
                        <Route path="/articles/:id" component={ArticleComponent} />
                    </Switch>
                </>
            </Router>
        )
    }
}

export default ArticleApp
